import React from "react";

function SignUp() {
  return (
    <div class="border border-black h-5">
      <div class="mb-3">
        <label for="exampleFormControlInput1" class="form-label">
          Email address
        </label>
        <input
          type="email"
          class="form-control"
          id="exampleFormControlInput1"
          placeholder="name@example.com"
        />
      </div>
    </div>
  );
}

export default SignUp;
